function Home() {
    return (
        <div className="Hometext">
            <h2>Новый год, больше игр, меньше отходов</h2>
            <h2>Больше 1000 игрушек!</h2>
            <h5>более доступная и экологичная альтернатива покупке игрушек по цене от 6000 тенге.</h5>
        </div>
        )
}

export default Home;
